export const Card = (props) => {
  const { url, title, propfileUrl, author, price } = props;
  return (
    <div>
      <img src={props.url} alt={props.title} width="480" />
      <h2>{props.title}</h2>
      <p>
        Author: <a href={props.authorName}>{props.profileUrl}</a>
      </p>
      <p>Price: {props.price}</p>
      <p>Quantity: {props.quantity}</p>
      <button>Add</button>
    </div>
  );
};
